<html><head>
    <meta charset="utf-8">
    <title></title>
    <style media="all">
        body {
            margin: 0;
            padding: 2px;
            font-family: 'Open Sans', sans-serif;
            font-size: 14px;
            box-sizing: border-box;
        }

        *, *:before, *:after {
            box-sizing: inherit;
        }

        .widget-preview-wrapper {
            display: inline-block;
        }

        .widget-preview {
            overflow: hidden;
            position: relative;
            border-radius: 5px;
            border: 1px solid #ffffff;
                        box-shadow: none;
                                    background-color: rgba(255,255,255,1);
                    }

        .widget-copyright {
            display: block;
            text-align: center;
        }

        .widget-copyright a {
            text-decoration: none;
            padding: 0;
            font-size: 12xpx;
            color: #3c3c3c;
        }

        /* head */
        .widget-preview__title {
            position: relative;
            padding: 5px;
            background-color: #000000;
            overflow: hidden;
        }

        .widget-preview__title a {
            display: block;
            width: 100%;
            height: 25px;
            color: #fff;
            font-size: 18px;
            text-decoration: none;
        }

        .widget-preview__title span {
            position: absolute;
            top: 5px;
            left: 40px;
            height: 25px;
            overflow: hidden;
            vertical-align: top;
        }

        .widget-profile {
            width: 100%;
            border-collapse: collapse;
            text-align: center;
        }

        .widget-profile::after {
            display: block;
            content: '';
            clear: both;
        }

        .widget-profile td {
            border: 1px solid #c3c3c3;
        }

        .profile-image {
            padding: 8px;
            width: 80px;
            border-left: 0 !important;
        }

        .profile-image img {
            width: 60px;
            height: 60px;
        }

        .profile-data {
            padding: 0 5px 5px 5px;
            font-weight: bold;
        }

        .profile-data:last-child {
            border-right: 0 !important;
        }

        .profile-data span {
            display: block;
            font-size: 9px;
            font-weight: bold;
            color: #999;
        }

        .profile-subscribe {
            border-right: 0 !important;
        }

        .profile-subscribe a {
            display: inline-block;
            padding: 3px 15px;
            border: 3px solid #FFF;
            border-radius: 5px;
            box-shadow: 0 0px 2px rgba(0, 0, 0, 0.5);
            color: #fff;
            text-decoration: none;
            font-weight: bold;
            background-color: #000000;
        }

        /* images table */
        .widget-body {
                        background-color: "transparent";
                    }

        .widget-body table {
            border-collapse: collapse;
            margin: 0 auto;
        }

        .widget-body tr {
            margin: 0;
            padding: 0;
        }

        .widget-body td {
            box-sizing: content-box;
            margin: 0;
            padding:  1px;
            font-size: 0;
            overflow: hidden;
            position: relative;
            width: 78px;
            height: 78px;
        }

        .widget-body img {
            position: absolute;
            top: -1000%;
            bottom: -1000%;
            margin: auto;
            display: block;
            /*height: 100%;*/
            padding: 2px;
            width: 78px;
            box-sizing: border-box;
                    }

    </style>
</head>
